import React from "react";
import PropTypes from "prop-types";
import {Router,Link } from "react-router-dom";
import styles from "./styles.module.scss";
import gold_1 from "../../images/gold_1.png"
const Summoner = (props, context) => (
  <div className={styles.summoner}>
      <div className={styles.box}>
        <div class="SummonerRatingMedium">
          <div class="Medal tip tpd-delegation-uid-1" title="">
            <img
                src={gold_1}
                alt={"Logo"}
                className={styles.logo}/>
            <img src="//opgg-static.akamaized.net/images/medals/gold_4.png?image=q_auto:best&amp;v=1" class="Image"/>
          </div>
          <div class="TierRankInfo">
            <div class="RankType">땅히</div>
               
          </div>
        </div>
      </div>
  </div>
);

Summoner.propTypes = {
  loading : PropTypes.bool.isRequired,
};

export default Summoner;
